import React from "react";


function Footer(){
    return(
        <section id="footer" className="colored-section">

            <div className="container-fluid">
                <div className="footerIcones">
                <a class="footer-link" href="https://www.linkedin.com/">LinkedIn</a>
                <a class="footer-link" href="https://twitter.com/">GitHub</a>
                <a class="footer-link" href="https://www.appbrewery.co/">Email</a>
                </div>
            </div>

        </section>
    )
}


export default Footer;
